Description: Lunch is served!When the bank threatening to foreclose, operating a food truck wasn't the best solution for Kayden Kross, unless you're serving the 'special'. Adrianna Luna helps turn Kayden's luck around by putting her delicious self on the lunch menu. When Kayden tries, it gets her a night in the slammer. When she is offered a 'get out of jail free card' by officer Bill Bailey, Kayden loses her chance to Christy Mack &amp; Yurizan Beltran, who fuck their way to freedom. Her only solution now, sell her food truck to Evan Stone and duck him and the bank manager James Deen, to financial independence.

Cast: Kayden Kross   Christy Mack   James Deen   Evan Stone   Yuri Luv   Adrianna Luna   Tommy Gunn   Mackenzee Pierce   Toni Ribas   Bill Bailey   Marcus London  

